description:
Category	Feature

Starring	Ava Addams, James Deen, Erik Everhard, Allie Haze, Andy San Dimas, Maddy O'Reilly, Missy Martinez, Ryan Driller, Chad White, Guilliana Alexis

Convicts, Erik Everhard and James Deen escape from prison and enter a gold mining camp, which just happens to employ two sexy parolees, Missy Martinez and Allie Haze. Their boss, played by Tommy Gunn, has worked these gorgeous girls to the core, since they refuse to succumb to his sexual innuendos. Just when things seem hopeless, the convicts shake things up by giving the girls some much needed pleasure. With criminals on the loose and cops on the lookout, this is a real find, filled with comedy, sex and gold! Also starring Ava Addams, Maddy O'Reilly, Andy San Dimas, Guilliana Alexis, Ryan Driller and Chad White!


